// Helper function
def show() = {
    val fileName="plot.png"
    import org.apache.commons.codec.binary.Base64
    val source = scala.io.Source.fromFile(fileName)(scala.io.Codec.ISO8859)
    val bytes = source.map(_.toByte).toArray
    source.close()
    print(s"%html <img height=480 width=480 src='data:image/png;base64,${Base64.encodeBase64String(bytes)}'/>")
}

%sparkr

f <- function(x) {
    x + 2
}

show(f(1))
